s = "abcd" ; t = "abcde"        # Output: "e"
s = "" ; t = "y"                # Output: "y"
s = ""
t = ""

import string

class Solution:
    def findTheDifference(self, s: str, t: str) -> str: # len(s);len(t)
        list1 = list(s)
        list2 = list(t)
        
        for stri in string.ascii_lowercase:
            # print(stri)
            if list1.count(stri) != list2.count(stri):
                return stri